	add("supercee", "{\"term\":\"supercee\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Presumed \u0027super-\u0027 + \u0027cee\u0027 a respelling of the physics symbol \u0027\u0027 (denoting the w:Speed of light|speed of light in a vacuum; an abbreviation of both English \u0027constant\u0027 and Latin \u0027celeritas\u0027 (swiftness) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Faster-than-light travelling speed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, Information Access Company, \u0027Analog Science Fiction/science Fact\u0027, [http://www.google.co.uk/books?id\u003dW5AQAAAAIAAJ\u0026amp;q\u003dsupercee\u0026amp;dq\u003dsupercee\u0026amp;pgis\u003d1 pp63\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;, 73\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;, \u0026amp; 77\u0026lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;But Man had always been a restless, persistent creature, and the stars called, and in an incredibly short space of time a highly-ingenious refinement of the theta drive gave him \u0027\u0027supercee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;“What I can’t understand, Psy, is why in the name of Mira the Terrans couldn’t have been admitted to the Federation as soon as they developed \u0027\u0027supercee\u0027\u0027. […\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;Offhand I’d say that the Terrans, when they hit on the secret of star-driving a planet, which isn’t much of a trick once the \u0027\u0027supercee\u0027\u0027 principle is clearly understood, decided to go off on a hunt round the galaxy for a see-tee system\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, A\u0026lt;small\u0026gt;UTHOR UNKNOWN\u0026lt;/small\u0026gt;, \u0027Astounding Science-fiction\u0027, [http://www.google.co.uk/books?id\u003ddUwEAAAAYAAJ\u0026amp;q\u003dsupercee\u0026amp;dq\u003dsupercee\u0026amp;pgis\u003d1 pp70\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;, 72\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;, \u0026amp; 73\u0026lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;]; presumed to be an earlier work (\u0027\u00271930\u0027\u0027 or earlier), as quotations 2 and 3 also appear in\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, Information Access Company, \u0027Analog Science Fiction/science Fact\u0027, [http://www.google.co.uk/books?id\u003dW5AQAAAAIAAJ\u0026amp;q\u003d%22all+about+a+little+thing+called%22\u0026amp;dq\u003d%22all+about+a+little+thing+called%22\u0026amp;pgis\u003d1 p72\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;“[…] A couple of\u0026lt;!-- Outside the scanning zone; presumed to be a short measurement of time --\u0026gt; … after the last rescue ship had lif\u0026lt;!-- Outside scanning zone; presumed “lifted off” --\u0026gt; … into space and shifted into the\u0026lt;!-- Outside scanning zone; presumed “safety” --\u0026gt; … of \u0027\u0027supercee\u0027\u0027, the star exploded\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;“Surely you know the answer to that one,” he said after a moment or two, “or have you forgotten all about a little thing called the decrement effect?” The Psychologist nodded. “Precisely. The decrement effect. The factor that makes \u0027\u0027supercee\u0027\u0027 — \u0027\u0027supercee\u0027\u0027 as we know it, that is — inoperable in intergalactic space.” He looked thoughtful. “I don’t think anyone’s yet evolved a satisfactory theory to account for the existence of the effect. The only thing that’s certain is that it’s tied up in some way with gravity fields — or, rather, with the absence of g-fields.” He shrugged\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;“What I can’t understand, Psy, is why in the name of Mira the Terrans couldn’t have been admitted to the Federation as soon as they developed \u0027\u0027supercee\u0027\u0027. […\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Frank Northen Magill, \u0027Survey of Science Fiction Literature\u0027, [http://www.google.co.uk/books?id\u003d3hoYAAAAIAAJ\u0026amp;q\u003dsupercee\u0026amp;dq\u003dsupercee\u0026amp;pgis\u003d1 p937] (Salem Press, ISBN 0893561967\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The core was virtually unreachable at \u0027\u0027supercee\u0027\u0027 velocities. So the Lost Star’s bleep has been sounding for eighty years, and no ship has reached her\", \"priority\":12}]}, \"synonyms\":{}}");

	add("supercell", "{\"term\":\"supercell\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|cell|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A severe thunderstorm with updrafts and downdrafts that are in near balance, allowing the storm to maintain itself for several hours. Supercells often produce large hail, powerful downpours, very strong winds and sometimes tornadoes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A repeating unit cell of a crystal that contains several primitive cells\", \"priority\":2}]}, \"synonyms\":{}}");

