	add("supercherie", "{\"term\":\"supercherie\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Italian\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027supercherie\u0027 from Italian \u0027soperchieria\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"foul Foul play; an attack made by deceit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.27\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"it is a \u0027\u0027Superchiery\u0027\u0027, as being wel armed, to charge a man who hath but a piece of a sword, or being sound and strong, to set upon a man sore hurt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Deception, deceit; an instance of fraud\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1863\u0027\u0027, Henry Rogers, ‘Critique on M. Renan\u0027s \u0027Vie de Jésus\u0027’\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Weshould certainly deny to any teacher of morals, in any age, who resorted to such ‘\u0027\u0027\u0027supercherie\u0027\u0027\u0027’ and charlatanism, any very high place among the instructors and benefactors of mankind\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027The Guardian\u0027, 23 June\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"According to France\u0027s foreign minister, the British foreign secretary is guilty of perpetrating a \u0027\u0027supercherie\", \"priority\":8}]}, \"synonyms\":{}}");

