	add("superclub", "{\"term\":\"superclub\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|club|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very large or high-profile nightclu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Bill Brewster, Frank Broughton, \u0027Last night a DJ saved my life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At his worst, a DJ in a \u0027\u0027superclub\u0027\u0027 is just working to build a brand\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, David Bell, Mark Jayne, \u0027City of quarters: urban villages in the contemporary city\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the Head of Communications at Cream claimed their resource-strong status as a \u0027\u0027superclub\u0027\u0027 which took control of their DJ artists\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Ethan Wolff, Karen Quarles, \u0027Frommer\u0027s Irreverent Guide to Manhattan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"New to the scene is Crobar, a \u0027\u0027superclub\u0027\u0027 with the space to hold just about every subculture in the New York pantheon. The music is as varied as the patrons\", \"priority\":7}]}, \"synonyms\":{}}");

	add("supercock", "{\"term\":\"supercock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|cock|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large penis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, \u0027Penthouse Magazine\u0027, Volume 8, Issues 1-6 ([http://books.google.com/books?ei\u003dbe3TT7qUEaT10gGX7MC8Aw\u0026amp;id\u003dFLJXAAAAMAAJ\u0026amp;dq\u003dsupercock\u0026amp;q\u003d%22count+as+a+supercock%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"search_anchor link\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I would say that a thickness of 2 ins diameter and a length of 11 ins would count as a \u0027\u0027supercock\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Jim Izrael, \u0027The Denzel Principle: Why Black Women Can\u0027t Find Good Black Men\u0027, St. Martin\u0027s Press (2010), ISBN 9780312534851, [http://books.google.com/books?id\u003dOj6_HdSWbMEC\u0026amp;pg\u003dPA140 page 140\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The problem with the argument about the absentee daddy is that in order to buy into it, you have to believe that black women are dumb as rocks, and that the black \u0027\u0027supercock\u0027\u0027 is a mystical one-eyed wonderweasel that mesmerizes and hypnotizes defenseless young black girls\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A formidable gamecock\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, w:Alejandro Alejandro Roces, \u0027Of Cocks and Kites, and Other Short Stories\u0027, Regal Publishing Co. (1959), page 61\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You know, I could understand your anxiety if you were betting on just any rooster. But when you wager on a \u0027\u0027supercock\u0027\u0027 like this, why, it\u0027s just like putting your money on San Miguel.\u0026quot\", \"priority\":9}]}, \"synonyms\":{}}");

