	add("supercomputer", "{\"term\":\"supercomputer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|computer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any computer that has a far greater processing power than others of its day; typically they use more than one core and are housed in large clean rooms with high air flow to permit cooling. Typical uses are weather forecasting, nuclear simulations and animations\", \"priority\":1}]}, \"synonyms\":{}}");

