	add("supercontinent", "{\"term\":\"supercontinent\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|continent|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very large continent that split into smaller ones in the Earth’s geologic past\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sometimes used to refer, due to their being composed of multiple continents, to one of the following modern landmasses: Afro-Eurasia and the Americas. (compare subcontinent\", \"priority\":2}]}, \"synonyms\":{}}");

