	add("supercube", "{\"term\":\"supercube\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|cube|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An analogue of the square or cube in arbitrary dimension: \u0026lt;math\u0026gt; {0,1 }^n\u0026lt;/math\u0026gt; along with the \u0026lt;math\u0026gt;(n-1)\u0026lt;/math\u0026gt;-dimensional balls joining every \u0026lt;math\u0026gt;2^{n-1}\u0026lt;/math\u0026gt; such points that share a coordinate, or any space equivalent to the same\", \"priority\":1}]}, \"synonyms\":{}}");

