	add("superdetective", "{\"term\":\"superdetective\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|detective|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extremely skillful or dedicated detectiv\", \"priority\":1}]}, \"synonyms\":{\"list\":[{\"text\":\"superdick\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("superdiet", "{\"term\":\"superdiet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|diet|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diet with remarkable health or slimming properties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Frank Konishi, \u0027Eat anything exercise diet: how to be slim and fit for life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"John just \u0026quot;finished\u0026quot; one of the \u0027\u0027superdiets\u0027\u0027 you\u0027ve read about, and when he got down to his goal weight — 150 pounds — he began eating everything he liked\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, James M Corry, \u0027Consumer health: facts, skills, and decisions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In short, there is no such thing as a \u0027\u0027superdiet\u0027\u0027 to increase one\u0027s potential\", \"priority\":5}]}, \"synonyms\":{}}");

	add("superdollar", "{\"term\":\"superdollar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|dollar|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A counterfeit United States $100 bill of very high quality\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superdomain", "{\"term\":\"superdomain\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|domain|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A taxonomic grouping above domain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Two or more conserved domains of nominally unrelated origin that appear in the same order in diverse proteins and are inherited as a single structural/functional unit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The domain to which a subdomain belongs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Rob Kirkland, \u0027Domino System Administration\u0027 (page 76\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Notes provides your Internet domain name (as it appears in the computer\u0027s TCP/IP setup and minus the \u0027\u0027superdomain\u0027\u0027 (org, net, and so on) component) as a default\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Robert Reinhardt, Joey Lott, \u0027Flash MX 2004 ActionScript Bible\u0027 (page 537\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Flash disallowed access only between two completely different \u0027\u0027superdomains\u0027\u0027, but allowed access between two different subdomains and/or protocols\", \"priority\":7}]}, \"synonyms\":{}}");

	add("superego", "{\"term\":\"superego\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\"], \"text\":\"{{compound|super|ego|lang\u003den}}, from earlier form \u0027lang\u003den\u0027 calqued after German \u0027lang\u003dde\u0027 from \u0027lang\u003dde|über-\u0027 () + \u0027lang\u003dde|ich\u0027 () from the pronoun \u0027lang\u003dde|ich\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of the mind that acts as a self-critical conscience, reflecting social standards that have been learnt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Still, it would be an error to believe that psychoanalytic\u0026lt;br\u0026gt; theory makes no contribution to describing and assessing\u0026lt;br\u0026gt; different types of ethical conduct. The crucial notion in this\u0026lt;br\u0026gt; connection is the relative rigidity or flexibility of the \u0027\u0027superego\u0027\u0027.\u0026lt;br\u0026gt; The childish, immature, or neurotic \u0027\u0027superego\u0027\u0027 is rigid; it is\u0026lt;br\u0026gt; characterized by slavish adherence to rules which, moreover,\u0026lt;br\u0026gt; may not be clearly understood. The mature or normal \u0027\u0027super-\u0026lt;br\u0026gt; ego\u0027\u0027, on the other hand, is flexible; it can evaluate the situation\u0026lt;br\u0026gt; at hand and modify the rules accordingly. Thus, in an early,\u0026lt;br\u0026gt; classic paper, Strachey suggested that the basic aim of psycho-\u0026lt;br\u0026gt; analytic treatment is to make such \u0026quot;mutative interpretations\u0026quot;\u0026lt;br\u0026gt; as would help to render the patient\u0027s \u0026quot;rigid \u0027\u0027superego\u0027\u0027\u0026quot; more\u0026lt;br\u0026gt; \u0026quot;flexible\u0026quot;.\u0026lt;sup\u0026gt;\u0026lt;small\u0026gt;8\u0026lt;/small\u0026gt;\u0026lt;/sup\u0026gt; Like the psychoanalytic theory of the \u0027\u0027superego\u0027\u0027, on\u0026lt;br\u0026gt; which it is based, this view suffers from the limitation of being\u0026lt;br\u0026gt; silent on what sort of rigidity is considered bad or undesirable\u0026lt;br\u0026gt; and what sort of flexibility is considered good or desirable. In\u0026lt;br\u0026gt; short, Freud and other psychoanalysts have persistently\u0026lt;br\u0026gt; dallied with normative systems without ever committing them-\u0026lt;br\u0026gt; selves on normative standards\", \"priority\":2}]}, \"synonyms\":{}}");

	add("superellipse", "{\"term\":\"superellipse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|ellipse|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a geometric shape constituting a transition between a rectangle and a circle; a closed curve, of which the circle and ellipse are special cases, whose parametric equation is x \u003d a.cos\u0026lt;sup\u0026gt;2/r\u0026lt;/sup\u0026gt;t, y \u003d b.cos\u0026lt;sup\u0026gt;2/r\u0026lt;/sup\u0026gt;t\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superellipsoid", "{\"term\":\"superellipsoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|superellipse|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A closed surface, of which the sphere and ellipsoid are special cases, whose parametric equation is x \u003d a.cos\u0026lt;sup\u0026gt;2/r\u0026lt;/sup\u0026gt;t, y \u003d b.cos\u0026lt;sup\u0026gt;2/r\u0026lt;/sup\u0026gt;t, z \u003d c.cos\u0026lt;sup\u0026gt;2/r\u0026lt;/sup\u0026gt;t\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superencryption", "{\"term\":\"superencryption\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|encryption|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The application of a series of multiple encryption processes to a text\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superfamily", "{\"term\":\"superfamily\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|family|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A taxonomic category above family and below order (and its subdivisions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large group of related proteins or other molecules\", \"priority\":2}]}, \"synonyms\":{}}");

