	add("superfatting", "{\"term\":\"superfatting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|fatting|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of excess fat in soapmaking to consume the alkali and give the soap a more moisturizing effect\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superfecta", "{\"term\":\"superfecta\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|super|perfecta|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A method of betting in which the bettor, in order to win, must pick the first four finishers of a race in the correct sequence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superfecundity", "{\"term\":\"superfecundity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|fecundity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency of organisms to produce more offspring than can possibly survive. The geometric growth of a biological population beyond the resources of the environment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Superabundant fecundity or multiplication of the species\", \"priority\":2}]}, \"synonyms\":{}}");

	add("superfetation", "{\"term\":\"superfetation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027superfetare\u0027 (conceive while pregnant) from {{prefix|super|fetus|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The formation of a fetus while another fetus is already present in the uterus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An excessive accumulation; a superfluous addition\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Geoffrey Wall, translator of\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"These gentlemen were greatly astonished at Bovary\u0027s romantic ideas, and the pharmacist hurried in to say to him: \u0026quot;This velvet looks to me rather a \u0027\u0027superfetation\u0027\u0027. Besides, the expense...\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("superflu", "{\"term\":\"superflu\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|flu|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any strain of flu that spreads unusually quickly, is unusually virulent, or is unusually unresponsive to treatment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superfluid", "{\"term\":\"superfluid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|fluid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A substance, such as liquid helium, that exhibits superfluidity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superfluity", "{\"term\":\"superfluity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027superfluite\u0027 from \u0027superfluitas\u0027 from Latin \u0027superfluus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being superfluous; in excess or overabundance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something superfluous, as a luxury\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"collective Collective noun for a group of nuns\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, Herbert A. Evans, \u0027Highways and Byways in Oxford and the Cotswolds\u0027, Macmillan and Co, (1905), [http://archive.org/stream/highwaysandbywa00griggoo\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"page/n288/ page 266\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"These probably mark the dwelling of a colony, or to speak more precisely, according to Dame Juliana Berners, a \u0027\u0027\u0027superfluity\u0027\u0027\u0027 of nuns from Godstow, which nunnery had a cell there, and was patron of the living\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Sam Cullen, \u0027The Odd Bunnies\u0027, [http://books.google.com/books?id\u003d9WFVD4_4x08C\u0026amp;pg\u003dPT24\u0026amp;dq\u003d%22superfluity+of+nuns%22 unnumbered page\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Alice put Anna back on the shelf and turned up the volume on the TV, where a local news reporter was imparting a salutary tale of woe involving a \u0027\u0027superfluity\u0027\u0027 of nuns who\u0027d got into a scrape at a crab festival\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Beth Yarnall, \u0027Rush\u0027, Crimson Romance (2012), ISBN 9781440554223, [http://books.google.com/books?id\u003dihKn6RBdHEEC\u0026amp;pg\u003dPT109\u0026amp;dq\u003d%22superfluity%22 unnumbered page\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That man could charm the panties off a \u0027\u0027superfluity\u0027\u0027 of nuns.”\", \"priority\":10}]}, \"synonyms\":{}}");

	add("superfluousness", "{\"term\":\"superfluousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|superfluous|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being superfluous\", \"priority\":1}]}, \"synonyms\":{}}");

