	add("supergene", "{\"term\":\"supergene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|gene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of neighbouring genes on a chromosome that are inherited together because of close genetic linkage and are functionally related in an evolutionary sense\", \"priority\":1}]}, \"synonyms\":{}}");

	add("supergirl", "{\"term\":\"supergirl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|girl|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A girl who is particularly successful, talented, or otherwise remarkable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Hal Erickson, \u0027Sid and Marty Krofft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"garrulous skull paperweight wresting the spotlight away from Ruby-Spears\u0027 flying cars, \u0027\u0027supergirls\u0027\u0027 and sasquatches\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Sharon Lamb, \u0027The Secret Lives of Girls\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And it ignores the privilege that helps only certain girls become \u0027\u0027supergirls\u0027\u0027 and makes them suffer when they come close to achieving this status\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, George Zhibin Gu, William Ratliff, \u0027China and the new world order\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An average Chinese girl, with talent in singing, dancing, or acting, can be elected a \u0027\u0027supergirl\u0027\u0027 by TV media outlets\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Esther Blum, Karen Salmansohn, \u0027Eat, Drink, and Be Gorgeous\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You may be a \u0027\u0027supergirl\u0027\u0027 on the go, but that doesn\u0027t mean you can\u0027t figure out ways to maximize your morning minutes with some simple nutrition\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Pier Cesare Rivoltella, \u0027Digital Literacy\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"emphasis on perfection, resulting in mounting pressure on girls to be \u0027\u0027supergirls\", \"priority\":11}]}, \"synonyms\":{}}");

	add("superglue", "{\"term\":\"superglue\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|glue|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very strong glue\", \"priority\":1}]}, \"synonyms\":{}}");

	add("supergraphics", "{\"term\":\"supergraphics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|graphics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Big graphics that are applied with vibrant colors, usually in geometric shapes, over walls or floors and ceilings to make the illusion of altered space.\u0026lt;ref\u0026gt;http://dictionary.reference.com/browse/supergraphics\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("supergravity", "{\"term\":\"supergravity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|gravity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A field theory combining supersymmetry and general relativity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superharmonic", "{\"term\":\"superharmonic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|harmonic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wave whose frequency is an integer multiple of that of another; an overtone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superhelix", "{\"term\":\"superhelix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|helix|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The shape formed by a helix which in turn is twisted into a larger helix\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superhero", "{\"term\":\"superhero\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|hero|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|Mighty Mouse in \u0026quot;Wolf! Wolf!\u0026quot; (1945\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any kind of fantasy/science fiction crime-fighting character, often with supernatural powers or equipment, in popular children\u0027s and fantasy literature\", \"priority\":2}]}, \"synonyms\":{}}");

	add("superhive", "{\"term\":\"superhive\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|hive|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An empty box placed above the existing boxes of the beehive in order to allow the colony to expand or store additional honey\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superhumanity", "{\"term\":\"superhumanity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|humanity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being superhuman\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superinflation", "{\"term\":\"superinflation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very high rate of inflatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A proposed inflation of spacetime in the early universe driven by the kinetic energy of the dilaton\", \"priority\":2}]}, \"synonyms\":{}}");

	add("superintelligence", "{\"term\":\"superintelligence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|intelligence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Remarkable intelligence, intelligence at or above and beyond the level of a genius\", \"priority\":1}]}, \"synonyms\":{}}");

	add("superiority", "{\"term\":\"superiority\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027superiorite\u0027 from \u0027superioritas\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being superio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Many colleges want to achieve football superiority\", \"priority\":2}]}, \"synonyms\":{}}");

