	add("superlative", "{\"term\":\"superlative\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027superlatyf\u0027 from Old french (842-ca. 1400) \u0027superlatif\u0027 from {{m|la|superlātīvus}}, from Latin {{m|la|superlātus||extravagant, of hyperbole}}, past participle of \u0027superfero\u0027 (carry over) from \u0027super\u0027 (above) + \u0027fero\u0027 (bear, carry)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The highest extent or degree of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The form of an adjective that expresses which of several items has the highest degree of the quality expressed by the adjective; in English, formed by appending \u0026quot;-est\u0026quot; to the end of the adjective (for some short adjectives only) or putting \u0026quot;most\u0026quot; before it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An adjective used to praise something exceptional\", \"priority\":3}]}, \"synonyms\":{}}");

	add("superlativeness", "{\"term\":\"superlativeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|superlative|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being superlative\", \"priority\":1}]}, \"synonyms\":{}}");

