	add("superpenis", "{\"term\":\"superpenis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|super|penis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very large or exceptional penis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, John A. Meeks, \u0027The Fragile Alliance: An Orientation to the Outpatient Psychotherapy of the Adolescent\u0027, Williams \u0026amp; Wilkins (1971), ISBN 9780683059311, [http://books.google.com/books?id\u003dgMtsAAAAMAAJ\u0026amp;q\u003d%22a+superpenis%22 page 123\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The youngster calmed down somewhat and recognized that he had been saying, in effect, that he had a \u0026quot;\u0027\u0027superpenis\u0027\u0027.\u0026quot; He laughingly asked, \u0026quot;I guess I made it sound like it was long enough to polevault with, eh?\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, John Sparks, \u0027The Sexual Connection: Mating the Wild Way\u0027, McGraw-Hill (1977), ISBN 9780070599086, [http://books.google.com/books?id\u003dgdtFAAAAYAAJ\u0026amp;q\u003dsuperpenises\u0026amp;dq\u003dsuperpenises\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daPHTT4DYFaj40gHb84HtBA\u0026amp;ved\u003d0CDIQ6AEwADgK page 8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The celebrated American sexologists William Masters and Virginia Johnson discovered that \u0027\u0027superpenises\u0027\u0027 tend to behave differently from average-sized versions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Donald A. Read \u0026amp; Judith Sutton, \u0027The Concept of Health\u0027, Holbrook Press (1978), ISBN 9780205056866, [http://books.google.com/books?id\u003d6926AAAAIAAJ\u0026amp;q\u003d%22superpenises%22 page 164\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Despite persistent legends of \u0026quot;\u0027\u0027superpenises\u0027\u0027,\u0026quot; the length of the \u0027average\u0027 human penis is three to three-and-a-half inches while flaccid\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Vamik D. Volkan, \u0026quot;Actualized unconscious fantasies and \u0027therapeutic play\u0027 in adults\u0027 analyses: further study of these concepts\u0026quot;, in \u0027Power of Understanding: Essays in Honour of Veikko Tahka\u0027 (ed. Aira Laine), Karnac Books (2004), ISBN 1855753952, [http://books.google.com/books?id\u003ds7oZnpdKO8AC\u0026amp;pg\u003dPA138\u0026amp;dq\u003dsuperdick\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2_DTT7CmDqSa0QHyh6CIAw\u0026amp;ved\u003d0CFcQ6AEwBw page 138\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"It soon became clear that what Sepp had done by buying this \u0026quot;superbike\u0026quot; was to go from having a non-functional penis to a \u0026quot;\u0027\u0027superpenis\u0027\u0027.\u0026quot\", \"priority\":9}]}, \"synonyms\":{}}");

