	add("superpussy", "{\"term\":\"superpussy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|super|pussy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A highly coveted vagina or by extension a desirable woma\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Amy Wallace, \u0027Sorcerer\u0027s apprentice: my life with Carlos Castaneda\u0027, [http://books.google.com/books?id\u003dQOyiKkog4roC\u0026amp;pg\u003dPA156\u0026amp;dq\u003dsuperpussy\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deJDVT-PyA4nu2gXevcmmDw\u0026amp;ved\u003d0CDgQ6AEwATgU page 156\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If you want to be the most orgasmic creature in all the universe, I\u0027ll make you into a \u0027\u0027superpussy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Roland S. Jefferson, \u0027One Night Stand: A Novel\u0027, [http://books.google.com/books?id\u003dfHMGIYKnYmUC\u0026amp;pg\u003dPA172\u0026amp;dq\u003dsuperpussy\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d04_VT_7EIIS42QWh9vCuDw\u0026amp;ved\u003d0CGgQ6AEwCTgK page 172\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A woman believing she has a \u0026lt;nowiki\u0026gt;\u0027\u0026lt;/nowiki\u0026gt;\u0027\u0027superpussy\u0027\u0027,\u0026lt;nowiki\u0026gt;\u0027\u0026lt;/nowiki\u0026gt; so strong that it\u0027ll pull the husband away from the wife\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jamie Alden, \u0027Kept\u0027, [http://books.google.com/books?id\u003d2-ozGYYJBOYC\u0026amp;pg\u003dPA56\u0026amp;dq\u003dsuperpussy\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deJDVT-PyA4nu2gXevcmmDw\u0026amp;ved\u003d0CD4Q6AEwAjgU page 56\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Angela and her \u0027\u0027superpussy\u0027\u0027 are so special\", \"priority\":7}]}, \"synonyms\":{}}");

