	add("superscription", "{\"term\":\"superscription\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027superscription\u0027 or its source, \u0027\u0027 from \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something written (or engraved) on the surface, outside, or above something else; specifically, an address on a letter, envelope, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, Pearl S. Buck, \u0027East wind: west wind\u0027, Moyer Bell, page 124\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Its \u0027\u0027superscription\u0027\u0027 was my name, and the name of the sender, my mother\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Sebastian\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 1140\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Schwartz glanced at the printed \u0027\u0027superscription\u0027\u0027 on the envelope and grumbled as he put the envelope away in his overcoat pocket, to read at leisure\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An editorial addition at the beginning, often indicating the authorship of a piece; compare colophon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027 \u0027By a pure error, or perhaps through a confusion in the traditions, Achish the Philistine (of Gath, 1 Sam. xxi., xxvii.), to whom David fled, is called Abimelech in the \u0027\u0027superscription\u0027\u0027 to Psalm 34.\u0027 — s:1911 Encyclopædia Encyclopædia Britannica\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The act of superscribing\", \"priority\":8}]}, \"synonyms\":{}}");

	add("supersector", "{\"term\":\"supersector\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|sector|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sector comprising several lesser sectors\", \"priority\":1}]}, \"synonyms\":{}}");

	add("supersession", "{\"term\":\"supersession\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027supersessio\u0027, from \u0027supersedere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of superseding; the fact of having been superseded\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, w:Henry Henry James, \u0027The Princess Casamassima\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Two points became perfectly clear: one was that she was thinking of something very different from her present, her past, or her future relations with Hyacinth Robinson; the other was that he was superseded indeed. This was so completely the case that it did not even occur to her, it was evident, that the sense of \u0027\u0027supersession\u0027\u0027 might be cruel to the young man\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Still excessively abundant, it was dressed in a manner of which the poor lady appeared not yet to have recognised the \u0027\u0027supersession\u0027\u0027, with a glossy braid, like a large diadem, on the top of the head\", \"priority\":5}]}, \"synonyms\":{}}");

