	add("supersign", "{\"term\":\"supersign\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|sign|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A higher-level sign\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A sign (panel bearing a message) that is highly technologically advanced or otherwise impressive\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, \u0027Lighting Dimensions\u0027 (volume 20, page 166\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the three \u0027\u0027supersigns\u0027\u0027 fabricated by County Neon Sign Corp. of Fairview, NY, the Virgin sign is composed of 6\u0026quot;-diameter stainless steel tubes set horizontally, with two bands of red neon running between each pair of tubes\", \"priority\":4}]}, \"synonyms\":{}}");

