	add("supersister", "{\"term\":\"supersister\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|super|sister|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a set of sisters of a haplodiploid species (e.g. honeybee, or any Hymenoptera) who are daughters of the same queen that was inseminated by a single male (drone). By contrast, full sisters of a diploid species (e.g. humans) share a genetic w: Coefficient of coefficient of relatedness of 0.5. Supersisters share 0.75 relatedness\", \"priority\":1}]}, \"synonyms\":{}}");

