	add("supplement", "{\"term\":\"supplement\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027supplementum\u0027 (that which is added to supply a shortage) from \u0027supplere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something added, especially to make up for a deficiency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An extension to a document or publication that adds information, corrects errors or brings up to date\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An additional section of a newspaper devoted to a specific subject\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;Mid-Lent, and the Enemy grins,\u0026quot; remarked Selwyn as he started for church with Nina and the children. Austin, knee-deep in a dozen Sunday \u0027\u0027supplements\u0027\u0027, refused to stir; poor little Eileen was now convalescent from grippe, but still unsteady on her legs; her maid had taken the grippe, and now moaned all day: \u0026quot;\u0027Mon dieu! Mon dieu! Che fais mourir!\u0027\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An angle that, when added to a given angle, makes 180°; a supplementary angle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A vitamin, herbal extract or chemical compound ingested to meet dietary deficiencies or enhance muscular development\", \"priority\":6}]}, \"synonyms\":{}}");

	add("suppletion", "{\"term\":\"suppletion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027supplere\u0027 (to supply) perfect stem \u0027supplet-\u0027, + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The supplying of something lacking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The use of an unrelated word or phrase to supply inflected forms otherwise lacking, e.g. using “to be able” as the infinitive of “can”, or “better” as the comparative of “good”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"More loosely, use of unrelated (or distantly related) words for semantically related words which may not share the same lexical category, such as father/paternal or cow/bovine\", \"priority\":3}]}, \"synonyms\":{}}");

