	add("supporter", "{\"term\":\"supporter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|support}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who gives support to someone or something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who supports, promotes, advocates or champions a cause or movement; an adherent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who provides moral or physical support to another; an attendant participating in a ceremony or procession\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"and his wife w:Queen Elizabeth The Queen Elizabeth, London, 12 May 1937\u0026amp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"url\u003dhttps://www.thegazette.co.uk/London/issue/34453/supplement/7056/|journal\u003d date\u003d10 November issue\u003d34453|page\u003d7031 at passage\u003dT\u0026lt;small\u0026gt;HE\u0026lt;/small\u0026gt; I\u0026lt;small\u0026gt;NTHRONIZATION\u0026lt;/small\u0026gt;. The King ascended the Theatre, accompanied by the two Bishops his \u0027\u0027Supporters\u0027\u0027, the Great Officers of State, the Lords carrying the Swords, and the Lords who had borne Their Majesties\u0027 Regalia, and was Inthroned by the Archbishops, Bishops, and the other Peers, who then stood about the steps of the Throne\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Someone who is a fan of a certain sports team or sportsperson\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There were 10,000 \u0027\u0027supporters\u0027\u0027 in the last match\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dWith the Stoke \u0027\u0027supporters\u0027\u0027 jeering Ziv\u0027s every subsequent touch, the pantomime atmosphere created by the home crowd reached a crescendo when Ziv was shown a straight red shortly after the break in extraordinary circumstances\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something that supports another thing\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Something that supports a structure such as a building or a sculpture\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An animal or figure that supports a shield in a coat of arms\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A garter worn around the leg to support a sock or stocking\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027, w:J. D. J. D. Salinger, \u0026quot;Zooey\u0026quot;, in, 1961, \u0027w:Franny and Franny and Zooey\u0027, 1991 LB Books edition, page 117\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"From the radiator, where he was attaching \u0027\u0027supporters\u0027\u0027 to his socks, Zooey glanced up at her\", \"priority\":14}]}, \"synonyms\":{}}");

